import React from "react";
import { NavLink } from "react-router-dom";
import style from "./HeaderBody.module.css";

function NAserver() {
  return (
    <div className={style.list}>
      <ul>
        <li>
          <NavLink to="" className={style.link}>
            Normal
          </NavLink>{" "}
        </li>
        <li>
          <NavLink to="" className={style.link}>
            Good
          </NavLink>{" "}
        </li>
        <li>
          <NavLink to="" className={style.link}>
            Busy
          </NavLink>{" "}
        </li>
        <li>
          <NavLink to="" className={style.link}>
            Hot
          </NavLink>{" "}
        </li>
        <li>
          <NavLink to="" className={style.link}>
            Upkeep
          </NavLink>{" "}
        </li>
      </ul>
    </div>
  );
}

export default HeaderBody;
